import React from "react";
import Link from "next/link";

export default function projects() {
  return (
    <div className="container">
      <header>
        <style jsx>
          {`
            ul {
              list-style-type: none;
              margin-right: 2rem;
            }

            a {
              float: right;
              color: white;
              text-align: center;
              padding: 10px;
              text-decoration: none;
              font-size: 20px;
              line-height: 35px;
              border-radius: 4px;
              display: block;
              font-family: "Roboto", sans-;
            }

            header {
              overflow: hidden;
              background-color: red;
              position: fixed;
              top: 0;
              width: 100%;
              float: right;
              padding: 5px 5px;
            }
          `}
        </style>
        <nav>
          <ul>
            <Link href="/contact">
              <a>Contact</a>
            </Link>
            <Link href="/projects">
              <a>Projects</a>
            </Link>
            <Link href="/about">
              <a>About Me</a>
            </Link>
            <Link href="/">
              <a>Home</a>
            </Link>
          </ul>
        </nav>
      </header>
      <div className="flex-container2">
        <div className="flex-item-left2" id="projects">
          <div className="project-tile">
            <style jsx global>{`

        .flex-container {
            text-align: center;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            width: 100%;
            height: 100vh;
          }

  body {
    background: lightblue}

  }
  .flex-container {
    display: flex;
    flex-direction: row;
    font-size: 20px;
    text-align: center;
  }

  .flex-item-left {
    background-color: #f39b6d;
    flex: 50%;
    width: 300px;
    padding: 30px;
  }

  .flex-item-right {
    padding: 30px;
    flex: 50%;
    background-color: #41e2ba;
    width: 300px;
  }
`}</style>
            <h4>Javascript Calculator</h4>

            <p className="">
              I created this calculator with vanilla JavaScript, HTML and CSS
              for my task during my bootstrap with hyperionDev{" "}
            </p>

            <a
              href="https://testcalculator.netlify.app/"
              className="button button2"
              target="blank"
            >
              Click Here
            </a>
          </div>
        </div>

        <div className="flex-item-right2">
          <div className="project-tile2">
            <h4> Online Store</h4>

            <p className="">
              This is a online store with add to cart functionality, you can add
              items to cart and remove it at will.
            </p>

            <a
              href="https://testonlinestore.netlify.app/"
              className="button button1"
              target="blank"
            >
              Click Here
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
